import React from "react";

class Icon extends React.Component {
    render() {
        const{className, onClick, size, ...attrs} = this.props

        const elemSize = size ? {fontSize: `${size}px`} : null;

        return (
           <i
           className={className}
           onClick={onClick}
           style={elemSize}
           {...attrs}
           />
        )
    }
};

Icon.defaultProps = {
    className: '',
    onclick: () => {},
    size: null
}

export default Icon;
